import React from "react";
import '../assets/css/matchHeader.css';
//import axios from 'axios';

const MatchHeader = props =>(
      <div className="container">
         <div className="row row-horizonal">
             <div className="card-group">
              <div className="card-block">match-1</div>
              <div className="card-block">match-2</div>
              <div className="card-block">match-3</div>
              <div className="card-block">match-4</div>
              <div className="card-block">match-5</div>
              <div className="card-block">match-6</div>
              <div className="card-block">match-7</div>
              <div className="card-block">match-8</div>
              <div className="card-block">match-9</div>
              <div className="card-block">match-10</div>
          </div>
          </div>
     </div>
);

export default MatchHeader;
